INSERT INTO `travel_photo_sendword` VALUES (1,'<h4><span style=\"font-weight: normal;\">因为这里有你，所以对我有着特殊的意义~深圳，挺漂亮的一座城市，我喜欢这里，更喜欢你~</span></h4>','2017-04-26 15:30:08','2017-04-26 15:30:08',3),(2,'ff 好帅 ss 好丑','2017-04-26 15:30:18','2017-04-26 15:30:18',1),(3,'ff 好帅 ss 好丑','2017-04-26 15:31:05','2017-04-26 15:31:05',4),(4,'ff 好帅 ss 好丑','2017-04-26 15:31:06','2017-04-26 15:31:06',2),(6,'<h5><span style=\"font-weight: normal;\">&nbsp; &nbsp; 早上十点从深圳出发，由于是五一小假期，出行的车流量较大，原本两小时左右的车程时间延长至四小时左右，到珠海香洲客车站已是下午四点。这次来珠海没有做详细的旅游攻略，只是简单地走走逛逛，看看当地的街头文化，所以也没打算去珠海周围的海岛珠海和长隆玩（珠海的长隆是看海上动物，广州长隆是看陆地动物，呵呵~），出了车站沿途闲逛了一会，就坐公交去了“莲花路步行街”。珠海当地人貌似比较少，公交也不拥挤，细细看着珠海这座城市，挺干净地，也让人觉得舒适，尤其是经过情侣路附近，沿海公路边的沙滩，适合散散心，感受下慢节奏的生活!</span></h5><div><h3 style=\"text-align: center;\"><span style=\"font-weight: normal;\">莲花路步行街-拱北口岸</span></h3><h5>&nbsp;<span style=\"font-weight: normal;\"> &nbsp; 到了莲花路步行街，就有些失望啦，既没有街区的繁华，也没有古街的韵味，更没有诱人的美食，10多分钟后就闪人了，从步行街穿出来就到了“拱北口岸”，建筑还蛮有特色，是全国第一大陆路口岸，这里可以通关到澳门。接近饭点时间，我们打算吃点海鲜，来之前在微博上有看到推荐“湾仔海鲜街”，为去这个地方找了好久，地图上显示的地标是在澳门，后来问了当地人，确定了就是在珠海市区，不过之后还是兜兜转转了好一会，因为公交站台不太好找，于是选择打车过去，下班高峰点，妈呀，堵得那车费噌噌噌的 ↑ &nbsp;↑ &nbsp;↑&nbsp;<br>&nbsp; &nbsp; 到达湾仔海鲜街，一下吸引我的不是海鲜街[捂脸][捂脸][捂脸]，而是“澳门旅游塔”，多少人的蹦极地首选，哈哈哈，一海之隔，超级近。以后要去珠海的可以提前把通行证办好，玩了珠海顺路玩圈澳门，说到这，湾仔海鲜街马路对面有一个“澳门环岛游”售票点，依稀记得票价一百出点，航行时间1小时，据说可以游轮会穿过澳门友谊大桥，观赏周边建筑以及澳门国际机场。个人建议白天环岛游比较好，虽然这个旅游项目我们没有去，我们到湾仔海鲜街时，天还没有黑，我们在口岸这边看澳门建筑还挺清晰，可吃完饭出来天黑了，澳门塔没有灯光，周围貌似也黑幽幽地，什么都看不见。</span></h5><h3 style=\"text-align: center;\"><span style=\"font-weight: normal;\">湾仔海鲜街</span></h3><h5 style=\"text-align: left;\"><span style=\"font-weight: normal;\">&nbsp; &nbsp; 海鲜街其实不长，但对于我们来说，那景象还是挺新鲜的！在这里，销售与加工是分开的，自主选购海鲜，然后将购买好的海鲜拿到你中意的酒楼去加工，节假日期间价格稍微偏高，一般清水煮类9元一份，蒸煮类18元一份、红烧类25元、蒜蓉类依稀记得是28元一份，每做一种种类加收5元，酒楼加工的价格家家都不多，可买海鲜就需要点讲价的功夫啦。我俩把海鲜街穿了个来回，收获，为零。。。。呵呵呵，还跟在一个大哥后面走，听别人砍价后的成果，同一家店，老板把40块一斤的基围虾卖给了那位大哥，等我绕一圈回来后自己讲价，她打死不卖给我了，非收我45，也是醉了。。。我就不信40块还买不到了，于是换了家店，依然挑到了又大、又肥、又嫩、又鲜的——</span>基围虾（一斤半）<span style=\"font-weight: normal;\">！！！不过称重的时候记得让卖家把口袋撕个洞把水放出来，因为装海鲜的时候同时也会把水装一些进去。后来又买了</span>6个鲍鱼<span style=\"font-weight: normal;\">，6块一个，价格合理；</span>2只大闸蟹<span style=\"font-weight: normal;\">，30一只，微微偏贵；</span>2个海胆<span style=\"font-weight: normal;\">，25块一个，价格可能合理；</span>2个扇贝<span style=\"font-weight: normal;\">，12块一个，个人觉得8块就可以入手1个。海鲜和加工总共花了400出点的样子，在旅游地这个价位还是可以接受的，加工酒楼是的士师傅推荐的“许山”，味道还是不错，像他说我这种无辣不欢的人都吃得很满足，我觉得还是挺好的勒！！！</span></h5><div>&nbsp; &nbsp;&nbsp;</div><div>&nbsp; &nbsp;&nbsp;<br></div></div>','2017-04-30 01:57:07','2017-04-30 01:57:07',6),(7,'<h3 style=\"text-align: center;\">广州塔-珠江夜游</h3><h5 style=\"text-align: left;\"><span style=\"font-weight: normal;\">&nbsp; &nbsp; 从珠海客车站坐车到达广东省客运站（与广州市客运站隔街相对）已是22：00左右，原来打算21：00到广州后直接去珠江乘坐游艇夜游珠江、观广州塔夜景，但后来未赶上游艇开放时间（18：00-22：30）导致计划取消，一方面，因客车到达时间延误；另一方面，客车中途会经停中山大学<span style=\"text-align: left;\">，</span><span style=\"text-align: left;\">中山大学到广州塔很近，由于</span><span style=\"text-align: left;\">不清楚路线，我们没有在在那点下车，因此，从中山大学继续开往省站的路途上浪费了30分钟左右的时间。最后，吃夜宵的心情也没有，在省站附近吃了碗酸辣粉就回酒店休息了。。。</span></span></h5><h3 style=\"text-align: center;\">早茶-點都德</h3><h5 style=\"text-align: left;\">&nbsp;<span style=\"font-weight: normal;\"> &nbsp; 一直都听说广州是吃货的天堂，尤其想感受一下粤式早茶，其实最想的还是本地的流沙包，想着那一口咬下去，包子馅立马就溢出来了，金色的、像金沙一样，哈哈哈，想想一下就觉得好饿好饿~~睡好起床后，便开始在美团上搜索广州比较出名的早茶餐厅。根据我们所住的海珠区鹭江区域，选择了點都德茶餐厅（凤凰楼店），也同样在中山大学附近。12：00到时已排起了长队，去吃的人还挺多，不过排位还算比较快，不过大众点评上可以网上排队，也可以优惠买单，美团也可以优惠买单，但无法网上预约排队。<br>&nbsp; &nbsp; 总体感觉味道还可以，只是可能因为自己菜没点好的原因，餐后觉得比较腻，最主要是没有吃到流沙包，流沙包早上就卖完啦，超级郁闷。在美团上，还有很多人推荐他们家的乳鸽，但是这个菜只有下午场才做，也没有吃到，有点遗憾。另外这家没人必须消费茶位，我们点的贡菊，配上菜品，还是挺清新地。在美团上还有推荐陶陶居，人均消费略高，下次再去广州可以去尝试~~<br></span><br></h5><h3 style=\"text-align: center;\">广州沙面建筑群</h3><h5 style=\"text-align: left;\"><span style=\"font-weight: normal;\">&nbsp; &nbsp; 下午16：00左右，肥肥临时决定带我去广州沙面建筑群看看，不错，懂我，很喜欢有文化底蕴的地方。广州沙面建筑群是广州最具异国风情的欧洲建筑，岛上</span><span style=\"font-weight: normal; color: rgb(51, 51, 51); font-family: arial, 宋体, sans-serif; font-size: 14px; text-indent: 28px; background-color: rgb(255, 255, 255);\">共有</span><span style=\"font-weight: normal;\">欧式建筑150多座，沙面曾是中国唯一的租界人工岛，是旧中国半封建半殖民地的历史见证，也是近代西方建筑文化输入中国的一个重要窗口；目前是多个国家驻广州领事馆所在地和在穗（广州的别称）外国人的主要活动区域。</span><span style=\"font-weight: normal;\">沙面岛外环绕着一条河，珠江河，映衬着这里的建筑，不错，很有国外的感觉。我们从地铁黄沙站下车后，过了一座人行天桥，来到沙面岛后便骑了摩拜单车环岛观赏，节省了很多体力，走走停停，遇到喜欢的建筑就停足拍照，超级适合拍照，美美哒！哈哈哈哈哈</span></h5>','2017-05-04 06:10:38','2017-05-04 06:10:38',7),(8,'here is gui_yang zun_yi','2017-06-01 06:56:21','2017-06-01 06:56:21',8),(9,'here is guang_xi yang_shuo','2017-06-02 04:11:36','2017-06-02 04:11:36',9);
